p.ref:
D'autres auront en mémoire leur lutte active pour l'équité salariale, pour les garderies, pour le droit à l'avortement, pour un changement des lois concernant le délit de viol et de harcèlement sexuel, pour le mariage entre personnes du même sexe, pour un registre canadien des armes à feu. Ici, je serais tentée de dire qu'il faudrait aussi avoir en mémoire le présent très récent et ne pas oublier que le gouvernement minoritaire(devenu ensuite majoritaire lors de l'élection du
2 mai 2011
) du premier ministre Stephen Harper a éliminé le Programme de contestation judiciaire, réduit le budget de Condition féminine au Canada, a coupé des millions de dollars au Programme d'apprentissage, d'alphabétisation et d'acquisition des compétences essentielles pour les adultes, a aboli le droit à l'équité salariale des fonctionnaires fédéraux et a présenté une loi qui ouvre la porte à la re-criminalisation de l'avortement.

div.p:
La reconnaissance a toujours été pour moi le filon premier porteur de solidarité et de projets. Qu'est-ce que je reconnais en toi qui fait partie de moi et constitue une partie de mon désir de vie, de mon système de valeurs, de mon expérience? Dans la reconnaissance, il y a aussi toute la question de l'image : quelle image ai-je des autres femmes, de moi en tant que femme? C'est d'ailleurs ce qui dans La lettre aérienne (
1985
) a donné lieu au texte  Une image captivante .
